import { isInMobileBrowser, type AdapterName } from '@amax/abstract-adapter';

export const metaMaskAdapterName = 'MetaMask' as AdapterName<'MetaMask'>;

export const metaMaskUrl = isInMobileBrowser()
    ? 'https://aplink.app/home'
    : 'https://chromewebstore.google.com/detail/armadillo/ahkbnfljhaifiikpkhnkeobchonbpjpb?hl=zh-CN&utm_source=ext_sidebar';

export const metaMaskIcon =
    'data:image/svg+xml;base64,';

export function openMetaMaskWallet(): boolean {
    if (!supportMetaMaskWallet()) {
        window.location.href = metaMaskUrl;
        return true;
    }
    return false;
}

export function supportMetaMaskWallet(): boolean {
    return window.ethereum && window.ethereum.isMetaMask;
}
